import React from 'react';
import './App.css';
import { Post1 } from './components/Post1/Post1';
import { Post2 } from './components/Post2/Post2';
import { Post3 } from './components/Post3/Post3';
import imageComment from './comment.svg';
import imageFavoriteWhite from './favorite-white.svg';
import imageFavorite from './favorite.svg';

const post3 = {
  usuario: "nome usuario",
  imageComment: imageComment,
  imageFavoriteWhite: imageFavoriteWhite,
  imageFavorite: imageFavorite,
}

class App extends React.Component {

  render(){
    return (
      <div className="App">
          <Post1  />
          <Post2/>
          <Post3 
            imageComment={post3.imageComment} 
            imageFavoriteWhite={post3.imageFavoriteWhite}
            imageFavorite={post3.imageFavorite}
            usuario={post3.usuario} 
            />
      </div>
    );

  }
}

export default App;
